import { useParams } from 'react-router-dom'
import { services } from '../assets/dummy.js'

export const Service = () => {
  const { service, itemId} = useParams();

  const filteredService = services.some(s => s.items?.filter(item => item.id === itemId) ? s.id : null)
  console.log(filteredService)

  return (
  <div className="h-screen flex justify-center items-center">
      {services.map(s => s.title === service && (
      <div key={s.id}>
        {s.items?.filter(item => item.id === itemId)}
      </div>
      ))}
  </div>
  )
}
